ads.description:
Mam do sprzedania samochód Renault;

Silnik 3 lata po remoncie kapitalnym, sprawny do jazdy;



Potrzebna homologacja na zbiornik gazu (koszt około 350 zł);

Do naprawy ogrzewanie oraz klimatyzacja;



Napęd 4x4 SPRAWNY



Szczegółowe informacje pod numerem:

69*******97

Wady:

1. Check engine (zdarza się, że silnik zaczyna tracić moc i nierówno pracować, najczęściej zaczyna się tak dziać, gdy często stoi na światłach itp., przy ciągłej jeździe jest raczej ok, po zgaszeniu i ponownym odpaleniu silnik znowu pracuje normalnie, były sprawdzane/wymieniane świece i cewki, kompresja na cylindrach jest ok, mechanik twierdzi, że może to coś z elektryką);

2. Duże ognisko korozji na lewym progu w okolicach tylnego koła, mniejsze ogniska na obu przednich błotnikach i drobne wypryski w kilku innych miejscach, trochę rys i obtarć na karoserii, niewielki obszar na dachu przy drzwiach kierowcy ze schodzącym klarem;

3. otwieranie klapy bagażnika tylko z pilota (nie działa przyciska na klapie);

4. Otwieranie auta tylko z pilota (mechanizm otwierania od strony kierowcy był wymieniany, ale bez dopasowywania zamka);

5. Brak listwy bocznej na drzwiach kierowcy (miałem gdzieś kupioną używkę do zamontowania, ale aktualnie wiem, gdzie jest), brak listy dolnej drzwi pasażera (mam ją luzem w bagażniku), brak osłonki klamki pasażera (mam ją luzem w aucie);

6. Radio działa, ale nie czyta CD.

Zalety:

1. Jeden właściciel w Polsce (auto kupione w 2010 r. - sprowadzone ze Szwecji);

2. Ogólny stan techniczny ok (manualna skrzynia biegów, hamulce, zawieszenie, układ kierowniczy, klimatyzacja, układ chłodzenia, szyby + luterka elektryczne, światła itd. działające i na bieżąco serwisowane) - samochód w ciągłym użytkowaniu (jedynie wspomniany wyżej problem z pracą silnika).

4. Przegląd ważny do 22.04.2026 r.;

5. OC ważne do 9.08.2025 r..;

6. Wnętrze w przyzwoitym stanie, jak na wiek auta (jedyne trochę przetarty fotel kierowcy, kierownica, przycisk od blokowania drzwi i pokrętło od świateł);

7. Na życzenie mogę podesłać link do większej liczby zdjęć.

Witam. Posiadam do sprzedania Seata Toledo III 1.9 TDI BKC 105 KM rok produkcji 2005. Auto w moim posiadaniu od 6 lat. W okresie posiadania wszystkie naprawy wykonywane na bieżąco. Z poważniejszych napraw regeneracja turbiny, wtrysków, wymienione sprzęgło, zaciski tył z tarczami oraz wiele innych. Auto posiada opony wielosezonowe zakupione latem. Świeżo po serwisie filtrów oraz oleju. W lato dobita i odgrzybiona klimatyzacja. PT 01.2026, OC 04.2025. Technicznie wsiadać i użytkować.



Wyposażenie to:



* Klimatyzacja;



* 4 poduszki powietrzne;



* Elektryczne szyby;



* Wspomaganie kierownicy;



* Centralny zamek;



* Czujniki parkowania tył;



* ABS;



* TCS;



* Radio multimedialne;



* Regulacja kierownicy dwu płaszczyznach;



* Regulacja fotela kierowcy w trzech płaszczyznach;



* ISOFIX.



Dla zainteresowanych więcej informacji udzielę telefonicznie.
